import "./About.css";

function About() {
  return (
    <section id="about" className="about-section">
      <h2>About Us</h2>

      <p>
        Sri Gaviranga Dental Clinic is committed to providing high-quality
        dental care with a focus on patient comfort, safety, and satisfaction.
      </p>

      <p>
        We offer a wide range of dental services including general dentistry,
        preventive care, cosmetic treatments, and emergency dental services.
      </p>

      <p>
        Our goal is to create healthy smiles using modern techniques and
        compassionate care.
      </p>
    </section>
  );
}

export default About;
